import React from 'react';

const divStyle = {
  color: '#082459',
  fontSize: '24px',
  fontFamily: 'Roboto',
  fontWeight: 700,
  wordWrap: 'break-word'
};

export default function Tabledata() {
  return (
    <div>
      <div>
        <img src="bg2.png" style={{maxWidth:'100%',height:'auto'}}></img>
      </div>
      <h1></h1>
      <div style={divStyle}>ผลิตภัณฑ์</div>
    </div>
  );
}
